import React from 'react';
import "./container.scss"
const Container = () => {
    return (
        <div className="Container">
            <div className="under_heaber">
                <img className="w-[471px] h-[680px] left-[109px] top-[24px] absolute rounded-[20px] shadow"
                     src="https://via.placeholder.com/471x680"/>
                <div
                    className="w-[300px] h-[60px] px-[26px] py-[5px] left-[651px] top-[380px] absolute bg-black rounded-[30px] border border-white justify-center items-center gap-2.5 inline-flex">
                    <div className="text-center text-white text-xl font-normal font-['Roboto']">Зарегистрироваться</div>
                </div>
                <div className="left-[642px] top-[56px] absolute text-white text-[80px] font-bold font-['Roboto']">Финал
                    в городе Волгоград
                </div>
                <div
                    className="w-[580px] left-[651px] top-[250px] absolute text-white text-lg font-normal font-['Roboto'] leading-loose">Вас
                    ждет большой розыгрыш призов, мощные проекты со всей страны и ГРАНДИОЗНОЕ фаер-шоу
                </div>
            </div>
        </div>
    );
};

export default Container;
